import React from "react";
import "../design/Home.css";
import { Row, Col, Container } from "react-bootstrap";

export default class Home extends React.Component {
  render() {
    return (
      <Container>
        <Row>
          <Col md={3} sm={2} className="graySidebar">
            Hello my name is Jayansh
          </Col>
          <Col md={9} sm={10} className="whiteCarryover">
            Hello I am the white page
          </Col>
        </Row>
      </Container>
    );
  }
}
